function SignedOutFooter(props) {
    return (
        <>
        <p>Please join us for our wedding celebration</p>
        <p>August 4th 2022</p>
        <p>Please <strong onClick={props.toggleForm}>sign in</strong> with your name and email to RSVP</p>
        </>
    )
}

export default SignedOutFooter;
